import React from 'react';
import '.././style/App.css';
import Sample from '.././feed/sample.json';




class Series extends React.Component {


  render(){

    return (
      <div>
        <div class="titre">
          <p>
            Popular Series
          </p>
        </div>
        <ul class="movie">{
          Sample.entries.map((s,i) => {

            return(

              <li key={i}>


                <h5>
                  {s.title}
                </h5>
                <img src={s.images.Poster_Art.url} height="100" width="100" />
              </li>
            );
          })
        }
        </ul>
      </div>
    )
  }
}

export default Series;
